import React from 'react';

const Pill = ({ onClick: handleClick, children }) => {
	return (
		<a
			onClick={handleClick}
			className="inline-block border border-blue-500 rounded py-1 px-3 bg-blue-500 text-white"
			href="#"
		>
			{children}
		</a>
	);
};

export default Pill;
